import React from 'react';
import { Switch } from "@nextui-org/react";

const FeatureRow = ({ feature, values }) => (
  <div className="grid grid-cols-4 gap-4 py-4 border-b border-gray-200">
    <div className="font-medium text-gray-900">{feature}</div>
    {values.map((value, index) => (
      <div key={index} className="text-center">{value}</div>
    ))}
  </div>
);

const Pricing = () => {
  const [isAnnual, setIsAnnual] = React.useState(false);

  const plans = [
    {
      name: "Starter VPS",
      price: isAnnual ? 5 : 7,
      cpu: "1 vCPU",
      ram: "1 GB",
      storage: "25 GB SSD",
      transfer: "1 TB",
    },
    {
      name: "Pro VPS",
      price: isAnnual ? 20 : 25,
      cpu: "2 vCPU",
      ram: "4 GB",
      storage: "80 GB SSD",
      transfer: "3 TB",
      isPopular: true,
    },
    {
      name: "Business VPS",
      price: isAnnual ? 80 : 100,
      cpu: "4 vCPU",
      ram: "16 GB",
      storage: "320 GB SSD",
      transfer: "5 TB",
    },
  ];

  return (
    <div className="bg-gray-50 min-h-screen py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        <h1 className="text-4xl font-extrabold text-gray-900 text-center mb-8">
          Choose Your VPS Plan
        </h1>
        <div className="flex justify-center items-center gap-4 mb-8">
          <span className="text-gray-700">Monthly</span>
          <Switch 
            checked={isAnnual}
            onChange={(e) => setIsAnnual(e.target.checked)}
            size="lg"
          />
          <span className="text-gray-700">Annual (Save 20%)</span>
        </div>
        <div className="bg-white shadow-xl rounded-lg overflow-hidden">
          <div className="grid grid-cols-4 gap-4 p-6 bg-gray-100">
            <div className="font-semibold text-gray-900">Features</div>
            {plans.map((plan, index) => (
              <div key={index} className="text-center">
                <h3 className="text-lg font-semibold text-gray-900">{plan.name}</h3>
                <p className="text-3xl font-bold text-indigo-600 mt-2">
                  ${plan.price}<span className="text-base font-normal text-gray-500">/mo</span>
                </p>
                {plan.isPopular && (
                  <span className="inline-block bg-indigo-100 text-indigo-800 text-xs px-2 py-1 rounded-full uppercase font-semibold tracking-wide mt-2">
                    Most Popular
                  </span>
                )}
              </div>
            ))}
          </div>
          <div className="divide-y divide-gray-200">
            <FeatureRow feature="CPU" values={plans.map(p => p.cpu)} />
            <FeatureRow feature="RAM" values={plans.map(p => p.ram)} />
            <FeatureRow feature="Storage" values={plans.map(p => p.storage)} />
            <FeatureRow feature="Transfer" values={plans.map(p => p.transfer)} />
          </div>
          <div className="grid grid-cols-4 gap-4 p-6 bg-gray-50">
            <div></div>
            {plans.map((plan, index) => (
              <div key={index} className="text-center">
                <button className="w-full bg-indigo-600 text-white rounded-md py-2 px-4 hover:bg-indigo-700 transition duration-150 ease-in-out">
                  Select Plan
                </button>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Pricing;
